  function getMeta(queryID) {

    // Single Entity
    if (queryID > 50000) {
      console.log("Type is -1")
      return {type: -1}
    }
    // Binary with list
    else if(queryID > 11000) {
       return {type: 11}
    }
    // List
    else if (queryID > 2000) {
       return {type: 2}
    }
    // Binary with Graph
    else if (queryID > 1000) {
       return {type: 1, xlabel: "_id", ylabel: "Count"}
    }
    // Graph
    else if (queryID > 0) {
       return {type: 0, xlabel: "_id", ylabel: "Count"}
    }

  }

  console.log("QueryID:",queryID);
  return {query: queries[parseInt(queryID)], meta: getMeta(queryID)}
